import React from 'react';
import LoginWithGoogle from "./googleLogin";


function Home(props){

const {handleLoginSuccess} = props;

    return(
        <div className="container div-home">
            <div className="container d-flex justify-content-center col-lg-6">
            <button className="btn-google-login col-lg-6"><LoginWithGoogle handleLoginSuccess={handleLoginSuccess} user={user} loading={loading}/></button>
           
            <a href="/login" className="btn-primary col-lg-6 btn-signin text-center">Sign in </a>
            </div>
        </div> 
    )
}

export default Home;
